import React from "react";
import Keg from "./Keg";
import PropTypes from 'prop-types';

const fakeKegList = [
  {
    name: 'Kombucha Plus Ultra',
    brand: 'Kombust',
    flavor: 'Mango Ginger',
    price: 6.99,
    quantity: 124
  },
  {
    name: 'Kombuchaya My Lord',
    brand: 'Insensitive Corp',
    flavor: 'Blueberry Tangerine',
    price: 7.99,
    quantity: 124
  }
];

function KegList(props){
  return(
    <React.Fragment>
      <hr/>
      {props.KegList.map((keg) =>
      <Keg whenKegClicked = {props.onKegSelection}
      name={keg.name}
      brand={keg.brand}
      flavor={keg.flavor}
      price={keg.price}
      quantity={keg.quantity}
      key={keg.id}/>
      )}
    </React.Fragment>
  );
}

KegList.propTypes = {
  KegList: PropTypes.array,
  onKegSelection: PropTypes.func
}

export default KegList;
